            </div>
            <h3 class="H3"> נסיעות קודמות:
            </h3>
            <div class="preDdrivesConetent">
                כאן תראה מידע על הנסיעה האחרונה שלך
            </div>
            <div class="feedback">
                <Button onClick={() => handleClick('FeedBack')}>
                    שליחת משוב
                </Button>
            </div>
        </div>
        </>
    );
};
